import { useEffect, useState } from 'react';
import { Link } from 'react-router-dom';
import Navbar from '../components/Navbar';
import Footer from '../components/Footer';
import { FiMapPin, FiHome, FiDroplet } from 'react-icons/fi';
import '../styles/UserDashboard.css';

function UserDashboard() {
  const [chalets, setChalets] = useState([]);

  useEffect(() => {
    console.log('Fetching chalets...');
    fetch('http://localhost/REAL_ESTATE_PROJECT/api/get_user_chalets.php', {
      credentials: 'include',
    })
      .then(res => {
        console.log('Response status:', res.status);
        if (!res.ok) throw new Error('Unauthorized');
        return res.json();
      })
      .then(data => {
        console.log('Response data:', data);
        if (data.chalets) {
          setChalets(data.chalets);
          console.log('Debug info:', data.debug);
        } else {
          setChalets(data);
        }
      })
      .catch(err => {
        console.error('Error fetching chalets:', err);
        setChalets([]);
      });
  }, []);

  return (
    <div className="user-dashboard-container">
      <Navbar />
      <div className="user-dashboard-scroll">

        <aside className="user-sidebar">
          <div className="sidebar-header">
            <h2 className="sidebar-title">
              <span className="gradient-text">User</span> Dashboard
            </h2>
          </div>
          <nav className="sidebar-nav">
            <ul>
              <li><a href="#home" className="nav-link">🏡 Home</a></li>
              <li><a href="#my-chalets" className="nav-link">🏠 My Chalets</a></li>
              <li><a href="#liked-chalets" className="nav-link">❤️ Liked Chalets</a></li>
              <li><a href="#requests" className="nav-link">📩 Requests</a></li>
              <li><a href="#settings" className="nav-link">⚙️ Settings</a></li>
            </ul>
          </nav>
        </aside>

        <main className="user-main">
          <header className="user-header">
            <h1>Welcome, <span className="gradient-text">User</span></h1>
            <p>{new Date().toLocaleDateString()}</p>
          </header>

          <div className="user-content">
            <section id="home" className="dashboard-section">
              <h2>🏡 Home</h2>
              <p>This is your home section overview.</p>
            </section>

            <section id="my-chalets" className="dashboard-section">
              <h2>🏠 My Chalets</h2>
              {chalets.length === 0 ? (
                <div className="chalet-list">No chalets found.</div>
              ) : (
                <div className="chalet-list">
                  {chalets.map((chalet) => (
                    <Link 
                      to={`/chalet/${chalet.id}`} 
                      key={chalet.id} 
                      className="chalet-card-link"
                    >
                      <div className="chalet-card">
                        <div className="image-container">
                          <img
                            src={chalet.main_image}
                            alt={chalet.title}
                            className="chalet-img"
                            loading="lazy"
                          />
                          <div className="property-badge">{chalet.status || 'Available'}</div>
                        </div>
                        <div className="chalet-details">
                          <h3>{chalet.title}</h3>
                          <div className="chalet-price">
                            {Number(chalet.price).toLocaleString()} MAD
                          </div>
                          <div className="chalet-address">
                            <FiMapPin /> {chalet.city}
                          </div>
                          <div className="chalet-meta">
                            <span><FiHome /> {chalet.bedrooms || 'N/A'} beds</span>
                            <span><FiDroplet /> {chalet.bathrooms || 'N/A'} baths</span>
                          </div>
                        </div>
                      </div>
                    </Link>
                  ))}
                </div>
              )}
            </section>

            <section id="liked-chalets" className="dashboard-section">
              <h2>❤️ Liked Chalets</h2>
              <p>Chalets you've liked.</p>
              <div className="chalet-list">No liked chalets.</div>
            </section>
          </div>
        </main>
      </div>
      <Footer />
    </div>
  );
}

export default UserDashboard;
